import React, { useState, useEffect } from 'react';
import './App.css';
import SudokuGenerator from './SudokuGenerator'; // Import the SudokuGenerator class

function SudokuView() {
  const [grid, setGrid] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    console.log('Generating a new Sudoku grid...');
    const generator = new SudokuGenerator();
    const newGrid = generator.generate();
    setGrid(newGrid);
    setLoading(false);
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="App">
      {grid.map((row, i) => (
        <div key={i}>
          {row.map((value, j) => <span key={j}>{value} </span>)}
          <br />
        </div>
      ))}
    </div>
  );
}

export default SudokuView;
